DROP DATABASE IF EXISTS students_test;
CREATE DATABASE students_test /*!40100 DEFAULT CHARACTER SET UTF8 */;

USE students_test;
CREATE TABLE groups (id INT PRIMARY KEY AUTO_INCREMENT COMMENT 'id группы'
,`name` VARCHAR(100) COMMENT 'Наименование группы'
) COMMENT 'Таблица групп';

CREATE TABLE students (id INT PRIMARY KEY AUTO_INCREMENT COMMENT 'id студента'
,`name` VARCHAR(100) COMMENT 'Имя студента'
,age INT COMMENT 'Возраст'
,id_group INT COMMENT 'id группы'
/*
, CONSTRAINT FOREIGN KEY
    FK_group (id_group)
    REFERENCES students (id)
    ON DELETE CASCADE
    ON UPDATE CASCADE
*/
) COMMENT 'Таблица студентов';


